import React from "react";

export const Card = ({ name , weight , temperament , image}) => {
  return (
    <div>
      <h3>{name}</h3>
      <h3>{weight}</h3>
      <h3>{temperament}</h3>
      <img src={image} alt='Not found' width='200px' height='250px'/>
    </div>
  )
};
